/* eslint @typescript-eslint/no-explicit-any: "off" */

import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';
import { ProjectDetails, Section } from '@/types/invoice';

// Define brand colors
const VAN_IMAGE_BASE64 = 'data:image/jpeg;base64,';

export const generatePDF = (projectDetails: ProjectDetails, sections: Section[]) => {
  // Start with portrait
  const doc = new jsPDF();
  let currentPage = 1;

  // First page header text
  doc.setFont('helvetica', 'normal');
  doc.setFontSize(10);
  doc.setTextColor(100, 100, 100);
  doc.text('Sinds 2012', 20, 20);
  
  // Subtitle
  doc.setFontSize(12);
  doc.text('Een aannemer op wie je kunt bouwen', 20, 30);

  // Main title
  doc.setFontSize(24);
  doc.setTextColor(50, 50, 50);
  doc.text('Offerte', 20, 45);

  // Project details left side
  doc.setFontSize(11);
  doc.text('Project adres', 20, 60);
  doc.text(projectDetails.projectAddress, 20, 65);
  doc.text(projectDetails.clientName, 20, 75);
  doc.text(projectDetails.email, 20, 80);
  doc.text(projectDetails.phone, 20, 85);

  // Project details box (right side)
  doc.setFillColor(245, 245, 245);
  doc.roundedRect(140, 20, 60, 70, 3, 3, 'F');
  doc.setFontSize(11);
  doc.text('Project details', 145, 30);
  doc.setFontSize(10);
  doc.text('Datum', 145, 40);
  doc.text(projectDetails.date, 145, 45);
  doc.text('Kenmerk', 145, 55);
  doc.text('Totaal renovatie ' + projectDetails.projectAddress, 145, 60);
  doc.text('Offertenummer', 145, 70);
  doc.text(projectDetails.invoiceNumber, 145, 75);
  doc.text('Geldigheid', 145, 85);
  doc.text(projectDetails.validity, 145, 90);

  // Company capabilities section
  doc.setFillColor(250, 250, 250);
  doc.roundedRect(20, 100, 170, 60, 3, 3, 'F');
  
  doc.setFontSize(14);
  doc.setTextColor(50, 50, 50);
  doc.text('De aannemer van groot Amsterdam', 30, 115);
  
  // Two column layout for capabilities
  doc.setFontSize(11);
  const checkmark = '';
  doc.text(`${checkmark} Ruwbouw`, 30, 130);
  doc.text(`${checkmark} Nieuwbouw`, 110, 130);
  doc.text(`${checkmark} Totaalrenovatie`, 30, 140);
  doc.text(`${checkmark} Staalframe bouw`, 110, 140);
  doc.text(`${checkmark} Sloopwerk`, 30, 150);
  doc.text(`${checkmark} Hallenbouw`, 110, 150);

  // Add uploaded header images if provided
  // @ts-expect-error - html2canvas options
  if (projectDetails.headerImages?.length) {
    // @ts-expect-error - html2canvas options
    projectDetails.headerImages.forEach((imgData, index) => {
      if (imgData) {
        const xPos = index === 0 ? 25 : 115;
        try {
          doc.addImage(
            imgData,
            'JPEG',
            xPos,
            170, // Y position
            80,  // Width
            50   // Height
          );
        } catch (error) {
          console.error(`Failed to add header image ${index + 1}:`, error);
        }
      }
    });
  }

  // Add van image at bottom
  try {
    doc.addImage(
      VAN_IMAGE_BASE64, // You'll need to provide this
      'JPEG',
      20,    // X position
      230,   // Y position
      170,   // Width
      50     // Height
    );
  } catch (error) {
    console.error('Failed to add van image:', error);
  }

  // Footer icons
  doc.setFontSize(10);
  doc.text('Kwaliteit', 30, 285);
  doc.text('Eigen mensen', 90, 285);
  doc.text('Persoonlijk', 150, 285);

  // Add page number
  doc.setFontSize(8);
  doc.text(String(currentPage), doc.internal.pageSize.width - 20, 290);
  currentPage++;


 // Add header images if provided
 // @ts-expect-error - html2canvas options
  if (projectDetails.headerImages?.length) {
    let xPos = 20;
    // @ts-expect-error - html2canvas options
    projectDetails.headerImages.forEach((imgData, index) => {
      if (imgData) {
        try {
          doc.addImage(
            imgData,
            'JPEG',
            xPos,
            20,   // Y position
            80,   // Width
            50    // Height
          );
          xPos += 90; // Space between images
        } catch (error) {
          console.error(`Failed to add header image ${index + 1}:`, error);
        }
      }
    });
  }

  // First page (Portrait)
  doc.setFontSize(10);
  doc.text(projectDetails.clientName, 14, 20);
  doc.text(projectDetails.email, 14, 25);
  doc.text(projectDetails.phone, 14, 30);
  doc.text(projectDetails.invoiceNumber, 14, 35);
  doc.text('Totaal renovatie', 14, 40);
  doc.text(projectDetails.projectAddress, 14, 45);
  doc.text(projectDetails.validity, 14, 50);
  doc.text(projectDetails.date, 14, 55);

  doc.setFontSize(16);
  doc.text('Offerte', 14, 70);
  doc.setFontSize(10);
  doc.text(projectDetails.projectAddress, 14, 80);
  doc.text(String(currentPage), 14, 290);
  currentPage++;

  // Second page (Portrait)
  doc.addPage();
  doc.setFontSize(10);
  doc.text('Geachte heer/mevrouw,', 14, 20);
  doc.text(`Hierbij treft u aan onze offerte voor de totaal renovatie van de ${projectDetails.projectAddress}`, 14, 30);
  
  doc.text('Werkzaamheden opgenomen in deze offerte:', 14, 50);
  let yPos = 60;
  const workItems = [
    'Slopen + stortkosten afval',
    'Staal constructies divers (zie nummering)',
    'Plaatsen binnenwanden',
    'Riolering + waterleidingen',
    'Plaatsen plafonds en isolatie',
    'Mechanische ventilatie',
  ];

  workItems.forEach(item => {
    doc.text(` ${item}`, 14, yPos);
    yPos += 6;
  });
  doc.text(String(currentPage), 14, 290);
  currentPage++;

  // Switch to landscape for product sections
  doc.addPage(); // Add new page
  doc.setPage(doc.getNumberOfPages()); // Get the last page
  doc.internal.pageSize.height = 210; // Set dimensions for landscape
  doc.internal.pageSize.width = 297;

  let startY = 20;
  sections.forEach((section) => {
    if (section.items.length > 0) {
      autoTable(doc, {
        startY: startY,
        head: [[
          {
            content: `${section.id} ${section.title}`,
            colSpan: 6,
            styles: { fillColor: [255, 255, 255], textColor: [0, 0, 0], fontStyle: 'bold' }
          }
        ],
        [
          'Omschrijving',
          'Aantal',
          'Eenheid',
          'Prijs',
          'Subtotaal',
          'BTW'
        ]],
        body: [
          ...section.items.map(item => [
            item.description || '',
            item.quantity.toString(),
            '',
            ` ${item.price.toFixed(2)}`,
            ` ${(item.quantity * item.price).toFixed(2)}`,
            `${section.vatRate}%`
          ]),
          [
            { content: '', colSpan: 3 },
            'Subtotaal',
            ` ${calculateSubtotal(section.items).toFixed(2)}`,
            ''
          ],
          [
            { content: '', colSpan: 3 },
            'Subtotaal incl.BTW',
            ` ${(calculateSubtotal(section.items) * (1 + section.vatRate/100)).toFixed(2)}`,
            ''
          ]
        ],
        theme: 'grid',
        styles: {
          fontSize: 9,
          cellPadding: 2,
        },
        columnStyles: {
          0: { cellWidth: 120 },
          1: { cellWidth: 25, halign: 'center' },
          2: { cellWidth: 25, halign: 'center' },
          3: { cellWidth: 30, halign: 'right' },
          4: { cellWidth: 30, halign: 'right' },
          5: { cellWidth: 25, halign: 'center' }
        },
      });

      startY = (doc as any).lastAutoTable.finalY + 10;

      if (startY > 180) {
        doc.addPage();
        doc.setPage(doc.getNumberOfPages());
        doc.internal.pageSize.height = 210;
        doc.internal.pageSize.width = 297;
        startY = 20;
        doc.text(String(currentPage), 14, 200);
        currentPage++;
      }
    }
  });

  // Switch back to portrait for final pages
  doc.addPage();
  doc.setPage(doc.getNumberOfPages());
  doc.internal.pageSize.height = 297;
  doc.internal.pageSize.width = 210;
  
  doc.setFontSize(11);
  doc.text('Voorwaarden', 14, 20);
  
  const terms = [
    'Op deze aanbieding zijn de UAV 2012 van toepassing met onderstaande afwijkingen:',
    'In het geval dat bepalingen in deze offerte strijdig zijn met bepalingen uit een eerder gesloten raamovereenkomst met dezelfde opdrachtgever, prevaleren de bepalingen uit de raamovereenkomst.',
  ];

  yPos = 30;
  terms.forEach(term => {
    const lines = doc.splitTextToSize(term, 180);
    // @ts-expect-error - html2canvas options
    lines.forEach(line => {
      doc.text(line, 14, yPos);
      yPos += 5;
    });
    yPos += 3;
  });

  doc.text(String(currentPage), 14, 290);

  // Save the PDF
  doc.save(`${projectDetails.projectAddress}-${projectDetails.invoiceNumber}.pdf`);
};

const calculateSubtotal = (items: any[]) => {
  return items.reduce((sum, item) => sum + (item.quantity * item.price), 0);
};

